import React from 'react';
import {funcTest} from '../Right/Ships'

class selectedShips extends React.Component {
    state = {
        isShowing: false
    };

    render() {
        let shipDiv = null;
        if (this.state.isShowing) {
            shipDiv = (
                <p>I'm HERE!</p>
            )
        }
        return (
            <div className="selected-ships">
                {shipDiv}
            </div>
        )
    }
}

export default selectedShips;
